import React, {useEffect, useState} from 'react';
import API from '../../services/API';
import './buildingDesign.css';




function Building() {
    const [buildingInfo, setBuildingInfo] = useState([])
    const [orderParam, setOrderParam] = useState("town")


    useEffect ( () => {
        getBuildings()
    }, []);


    async function getBuildings(){
        console.log("entro")
        const buildingResult = await API.getBuildings("town", 0)
        .then(res => {
            console.log(res.data)
            setBuildingInfo(res.data)
        })
    }




  return (
    <div className='building'>
      <div>
        <p>ordenado por: </p>
        <select value={orderParam}>
            <option value="town">Localidad</option>
            <option value="created" >Fecha de creacion</option>
        </select>
        <select value={orderParam}>
            <option value="town">Localidad</option>
            <option value="created" >Fecha de creacion</option>
        </select>
      </div>  
      <table>
        <tr>
          <th>ID</th>
          <th>area(Metros)</th>
          <th>Cuartos</th>
          <th>Precio</th>
          <th>Localidad</th>
          <th>Direccion</th>
          <th>Registrado</th>
        </tr>
        {buildingInfo.map((val) => {
          return (
            <tr>
              <td>{val.id}</td>
              <td>{val.area}</td>
              <td>{val.number_rooms}</td>
              <td>{val.price}</td>
              <td>{val.town}</td>
              <td>{val.address}</td>
              <td>{val.created}</td>
            </tr>
          )
        })}
      </table>
    </div>
  );
}

export default Building;
